import java.util.*;

public class Main {
    static int n, m;
    static boolean[] visited;
    static boolean[][] adj;
    static int[] dom;

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int t = 1;
        while (t-- > 0) {
            solve(scanner);
        }
    }

    static void solve(Scanner scanner) {
        n = scanner.nextInt();
        m = scanner.nextInt();
        adj = new boolean[n][n];
        dom = new int[n];
        visited = new boolean[n];

        for (int i = 0; i < m; i++) {
            int u = scanner.nextInt();
            int v = scanner.nextInt();
            adj[u][v] = adj[v][u] = true;
        }

        int ans = 0;
        for (int i = 0; i < n; i++) {
            Arrays.fill(dom, 0);
            Arrays.fill(visited, false);
            if (dfs(i)) {
                ans++;
            }
        }
        System.out.println(ans);
    }

    static boolean dfs(int u) {
        visited[u] = true;
        for (int v = 0; v < n; v++) {
            if (adj[u][v] && !visited[v]) {
                dom[v] = 1;
                if (!dfs(v)) {
                    return false;
                }
            }
        }
        return true;
    }
}
